`,paraId:13,tocIndex:3},{value:"formRef has several built-in methods to get the converted value, which is also more functional than antd's Form. For details, see the type definition of ProFormInstance.",paraId:14,tocIndex:3},{value:`  /** Get all data formatted by ProForm */
